import './card.css';
const card = (props) => {
    return (
        <div className="main_box">
            <img src ="//joeschmoe.io/api/v1/${props.name}" alt="avatar" />
            <h1>{props.name}</h1>
            <p>Age: {props.age}</p>
        </div>
    );
}
export default card;
